An archive celebration of Tom Jones\'s performances at the BBC from the start of his pop career
in the mid~60s to Later...with Jools Holland in 2010 and all points in between, including 
Top of the Pops and the Dusty Springfield Show. A chronological celebration of Sir Tom through 
the years that is also a history of music TV at the BBC over most of the past 50 years..

